    src = "/assets/img/chi.png";
  } else if (logo.toLowerCase().trim() === "det") {
    src = "/assets/img/det.png";
  } else if (logo.toLowerCase().trim() === "nsh") {
    src = "/assets/img/nsh.png";
  } else if (logo.toLowerCase().trim() === "stl") {
    src = "/assets/img/stl.png";
